async function searchItems(keyword) {
    mylist = document.getElementById("mylist")

    const searchableKeys = ["itemId", "itemName"];
    const newData = itemlist.filter(function (item) {
        return searchableKeys.some(key => {
            return item[key].toLowerCase().includes(keyword.toLowerCase());
        })

    })


    document.getElementById("mylist").innerHTML = "";
    for (datalist of newData) {
        const node = document.createElement("option");
        const textnode = document.createTextNode(`${datalist.itemName}`);
        node.appendChild(textnode);
        mylist.appendChild(node)
    }


    itemFilter = newData[0]
}


async function search() {
    const keyword = document.getElementById('item').value
    searchItems(keyword);

}

